import React from "react";
import { Routes, Route } from "react-router-dom";
import Nav from "./components/Nav/Nav"; // افترض أن مكون Nav في مجلد components/Nav
import Home from "../src/components/BannerHome"; // صفحة رئيسية
import About from "./pages/About"; // صفحة حول
import Contact from "./Contact"; // صفحة اتصل بنا

function App() {
  return (
    <>
      <Nav />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/about" element={<About />} />
        <Route path="/contact" element={<Contact />} />
      </Routes>
    </>
  );
}

export default App;
